import React, { Component } from "react";

import { Card, Icon, Avatar, Row, Col } from "antd";

const { Meta } = Card;

export default class Order extends Component {
  state = {
    data: [
      {
        id: 1,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      },
      {
        id: 2,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      },
      {
        id: 3,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      },
      {
        id: 4,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      },
      {
        id: 5,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      },
      {
        id: 6,
        url:
          "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
        title: "table1",
        description: "soup"
      }
    ]
  };

  handleDelete = dataId => {
    const data = this.state.data.filter(item => item.key !== key);
    this.setState({ data: data });
  };
  render() {
    const { data } = this.state;
    return (
      <div
        style={{
          background: "#fff",
          padding: 24,
          minHeight: 680
        }}
      >
        <Row gutter={2}>
          {data.map(a => (
            <Col span={6}>
              <Card
                id={a.id}
                style={{ width: 300, margin: "2em 2em" }}
                cover={<img alt="" src={a.url} />}
                actions={[
                  <Icon
                    type="delete"
                    key="setting"
                    onClick={this.handleDelete}
                  />,
                  <Icon type="edit" key="edit" />,
                  <Icon type="ellipsis" key="ellipsis" />
                ]}
              >
                <Meta
                  avatar={
                    <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
                  }
                  title={a.title}
                  description={a.description}
                />
              </Card>
            </Col>
          ))}
        </Row>
      </div>
    );
  }
}
